      return (
        <nav className="navbar">
          <h1 className="navbar-heading">HotelShare.com</h1>
          <div className="button-group">
            <button className='b1'>Login</button>
            <button className='b1'>Register</button>
          </div>
        </nav>
      );
    }
  }
  
  
  export default NavBar;
